    [],nt"num_tags": 7,nt"name": "narrative-report-june-july-1938-medicine-lake-migratory-waterfowl-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Medicine Lake
    NWR outlines Refuge accomplishments from June through July of 1938. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, predators, and rodents- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, haying, sharecropping, and timber removal. The public relations
    section of the report describes recreational uses and violations. Photographs are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
